module Main where

import           Data.Char
import           Utils
import Data.List.Utils (replace)

main :: IO ()
main = do
  ptNr <- partSelection
  input <- requestInput
  if ptNr == 1
    then print $ pt1 input
    else print $ pt2 input

pt1 :: String -> Int
pt1 = length . processString

pt2 :: String -> Int
pt2 input =
  let alphabet = ['a' .. 'z']
      keepsShortest alpha currentShortest =
        let processed = removeAndProcessString alpha input
         in if length processed > length currentShortest
              then currentShortest
              else processed
      shortest = foldr keepsShortest input alphabet
   in length shortest

removeAndProcessString :: Char -> String -> String
removeAndProcessString c s =
  let removed = removeFromPolymer c s
  in processString removed

processString :: String -> String
processString s =
  let originalLength = length s
      processed = onePass s
  in if length processed == originalLength
        then processed
        else processString processed

onePass :: String -> String
onePass (c1:c2:cs) =
  if isOpposite c1 c2
    then onePass cs
    else c1 : onePass (c2 : cs)
onePass [c1] = [c1]
onePass [] = ""

removeFromPolymer:: Char -> String -> String
removeFromPolymer c s =
  let lowerRemoved = Data.List.Utils.replace [toLower c] "" s
   in Data.List.Utils.replace [toUpper c] "" lowerRemoved

isOpposite :: Char -> Char -> Bool
isOpposite a b = (a /= b) && (toLower a == toLower b)

